export default async function getCardData () {
  const cardData = [];
  const request = await fetch("https://6075786f0baf7c0017fa64ce.mockapi.io/products");
  const data = request.json();
  data.map((item) => {
    return cardData.push(item);
  });
  return cardData;
}
